import "./styles.css";

const TotalMoney = ({ listTransactions }) => {
  const total = listTransactions.reduce((acc, total) => {
    return acc + total.value;
  }, 0);

  return (
    <div className="Div-total">
      <div>
        <p>Valor Total:</p>
      </div>
      <div>
        <p>${total}</p>
      </div>
    </div>
  );
};
export default TotalMoney;
